import React from "react";
import "./Todo.css";
import {
  List,
  ListItemText,
  ListItem,
  ListItemAvatar,
  Avatar,
} from "@material-ui/core";

function todo(props) {
  return (
    <List>
      <ListItem>
        <ListItemText primary="Todo" secondary={props.text} />
      </ListItem>
    </List>
  );
}

export default todo;
